import React from "react";
import "./LoginPage.css";
// import { FaBars, FaTwitter } from "react-icons/fa";
export default function LoginPage() {
  return (
    <div >
      <Navbar />
      <Login />
    </div>
  );
}
const Navbar = () => {
  return (
    <nav>
      <div className="nav-center">
        <div className="nav-header">
          <h2>LMS</h2>
        </div>
      </div>
    </nav>
  );
};

const Login = () => {
  return (
    <main className="bgc">
        <div className="title">
            Welcome to Learning Manage
        </div>
      <form></form>
    </main>
  );
};
